children.style:
// Ensure container is above bgImage
.container {
  position: relative;
}

// Add light border if two white
// sections next to each other.
.bg-white + &.bg-white {
  border-top: 1px solid #F0F0F0;
}

children.attributes:
{
	image: bgImage,
  opacity: bgImageOpacity,
  repeat: bgImageRepeat
}

children.style:
// Set using CSS vars defined
// in element inline style.
background-image: var(--image);
opacity: var(--opacity);
// Fill parent container
background-position: center center;
background-size: cover;
top: 0;
left: 0;
bottom: 0;
right: 0;
position: absolute;
// Place under other elements
z-index: 0;

// Make it a repeating pattern
&.repeat {
  background-size: auto;
  background-position: 0% 0%;
  background-repeat: true;
}

display: flex;
flex-wrap: wrap;
> div {
  display: flex;
  flex: none;
  justify-content: center;
  width: 100%;
  margin-bottom: 24px;
}

.brand {
  img {
    display: block;
    height: 32px;
  }
}

.social {
  align-items: flex-end;
}

.social, .links {
  a {
    color: inherit;
    &:hover {
      opacity: 0.8;
    }

    &:not(:first-of-type) {
      margin-left: 20px;
    }
  }
}

// Tablet and up
@media screen and (min-width: 768px) {
  > div {
    flex: 50%;
  }

  .left {
    justify-content: flex-start;
  }

  .right {
    justify-content: flex-end;
  }

  // Move links to end (bottom right)
  // Swaps position with social
  .links {
    order: 1;
  }
}

